(1, 1, 'Jason LeVine', 'http://www.youtube.com/channel/UCFHMWRaK8zw1j3U0PqZBxng', 'Doc I just want you to know this show is genius. You are a living legend. Hope you&#39;re back in action soon again on YouTube', 'https://yt3.ggpht.com/ytc/AKedOLTCsCrVLxx81gt2RixNbRGxXgDkjt5oyzQtfbmp8w=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 00:59:30', '2022-06-11 00:59:30'),
(2, 1, 'Chris L', 'http://www.youtube.com/channel/UC7BLSe2PLtUX3BCzqu9Go7w', 'I just got into teds budz and they are great have u tried ray-k 41, catch of the year or Hawaiian jelly roll?', 'https://yt3.ggpht.com/ytc/AKedOLSUfrTer7rAzqvcVjxKkC8ItBIR1EX9JmSWAA=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 00:59:30', '2022-06-11 00:59:30'),
(3, 1, 'Resin', 'http://www.youtube.com/channel/UCcqxVUhqCPED4KW53yrMR5w', 'Big squid is a winner in my book!!!<br>Awesome review DOC!! <br>Cloooooouuuuuuds!!!', 'https://yt3.ggpht.com/ytc/AKedOLRFmE352PEmgugx7yjxbdtYZhMLPle4Oa-R_sYxqRB2W6vxfXfI2CUjCxteY-Wb=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 00:59:30', '2022-06-11 00:59:30'),
(4, 1, 'Andrew Sandberg', 'http://www.youtube.com/channel/UCE98W9rJKyrQ1fEthCVCSsQ', 'I love gassy flower! the more gas/fuel the better! I will look for this thanks Doc (: love the video', 'https://yt3.ggpht.com/ytc/AKedOLSu9dnNShXNKmLLo9GYNnZWPEDouyJl-LaNGV75lw=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 00:59:30', '2022-06-11 00:59:30'),
(5, 1, 'Ddeven Ba6r', 'http://www.youtube.com/channel/UCnzneIO6w5Tk083sZY13Sug', 'Glad you liked it Doc. This was my 2nd fave of the year from Teds Budz right behind the Silky Wonka which I can&#39;t find anymore. Check out the new Red Eye OG by CBX, a nice old skool gassy/skunky OG. Reminds me of an old skool King Louis XIII OG or DaVinci OG.<br>I remember back in the medical days before the rec market, there was a way wider variety of strains and flavors of homegrown to choose straight from the huge mason jars.  I never see the Planetary strains anymore, very strong Star Wars strains like Vader OG/Yoda OG, etc., or straight Sativas are very rare nowadays.<br>How times have changed. Party on my Friend', 'https://yt3.ggpht.com/ytc/AKedOLTJAO7pdDljFCRLYOtJOtjIZpJ0IhDH9PC16w=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 00:59:30', '2022-06-11 00:59:30'),
(6, 1, 'alex rodriguez', 'http://www.youtube.com/channel/UCJRFX_4dkDV2lSps4j1KTfw', 'One of my favorites all year', 'https://yt3.ggpht.com/ytc/AKedOLQMO3l2me5iYTPBSht_InLRuEF_-NVRW4wqS818Pg=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 00:59:30', '2022-06-11 00:59:30'),
(7, 1, 'Loudawg01', 'http://www.youtube.com/channel/UCKnHpqLOLliCT8j7iK29YfQ', 'Hey Doc hope to see you back soon… got a couple picks for ya …Anything by Blue Print but I prefer the P 90. Old-school Bud….and 41 unicorns from Jelly Co  and Gooniez … both solid pics Doc… Hey and there’s a new dispensary out in LA I don’t know if you’ve seen it it’s called the goat and they got really good prices and really good selection…. Party on Doc!!!', 'https://yt3.ggpht.com/rdgHY5wXNlgbuLkg0XHE13QyRk429At4JnA37BVFG9a9ywM_Rrir0TnIw0pUGxspMwwda-BNsg=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 00:59:30', '2022-06-11 00:59:30'),
(8, 1, 'Chris Bryant', 'http://www.youtube.com/channel/UCFj-tF2jxo2liBRjpCdH43g', 'I miss you Doc!!! come back soon !!', 'https://yt3.ggpht.com/ytc/AKedOLTalRnXedZL80XWnK-YLFfP5KX1sMmbAaXENQV9_Q=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 00:59:30', '2022-06-11 00:59:30'),
