(11, 1, 'Art Deresh', 'http://www.youtube.com/channel/UC7oWRv8PMbxFlme2Cw8-okg', 'Hey Doc check out the Incredible new cookies flower Adios Mother Fucer, even Berner calls it the new hot fire he personally hand picked two years ago. Picked some up from Lemonade and man its  beyond top shelf, amazing over the top powerful dank pungent, possible in the top 3 next to A&amp;B and Gary. maybe even better. Simply AMAZING!!!', 'https://yt3.ggpht.com/ytc/AKedOLQ5CGRfyaz7bk55rFkWc49S8mwcD4hl3_Qh27VgP8_uxNFxg6rVf7mAOPsV5ePn=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 00:59:30', '2022-06-11 00:59:30'),
