(112, 14, 'Tom Zart', 'http://www.youtube.com/channel/UC7hV6LtH6GD1_wggLpZlMpg', 'POT FARMER LOVE SONG $$<br>I got out my pipe stuffed it with pot<br>You better believe it held a whole lot.<br>I whipped out a lighter thumbed up a flame<br>Sucked down that smoke which comforts my brain.<br><br>I tried alcohol smoked cigarettes<br>They did nothing but give me regrets.<br>My mom had arthritis could not walk around<br>I rolled her a joint she danced on the ground.<br><br>I thought I was losing my lovemaking knack<br>After I smoked some to me it came back.<br>Soon I decided prices were high<br>I searched for some ground I wouldn&#39;t have to buy.<br><br>I bargained for seeds from smokers all around<br> Got in my truck and drove out of town.<br>I walked through the woods where wild birds nest<br> Found me the meadow I thought was the best.<br><br>I dug up the ground sowed all my seeds<br>Said a small prayer for strong, healthy weeds.<br>I watered at night with a five-gallon pail<br> Mosquitoes went hungry for I wore a veil.<br><br>Seven months went by; I thought I would die<br>Till the Halloween moon was high in the sky.<br>At night I went out, in a camouflage suit<br> Used my corn knife to chop down the loot.<br><br>I hung it up to dry where it couldn’t be found.<br>Came back and got it, when it had turned brown.<br>I trimmed off the buds, stuffed them in bags<br>Called all my friends and passed out free drags.<br><br>In less than a week my crop was gone<br> I flew to St. Thomas with a love hungry blonde!!<br><br>By Kansas City Poet Tom Zart<br>Google = Most Published Poet On The Web<br>Tom’s 1,650 Poems Are Free To Share!<br>Google = George Bush Tom Zart', 'https://yt3.ggpht.com/ytc/AKedOLSmXrNQHA9qUkFC-yQYM5qOPiHr7GTNwQY5PSWtBQ=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 01:05:42', '2022-06-11 01:05:42'),
