(397, 45, '👑 King ZaZa 👑', 'http://www.youtube.com/channel/UCWCLh0BZEh7HpAgwW72aeUQ', '🔥🔥🔥🔥 I remember the day this dropped I traveled 2 hours to get this doc I agree it wasnt euphoric, that same day I picked up there peanut butter#4 and Pine-Zol. The Pine-Zol had the calmest packing but it was definitely the most enjoyable smoke. It was another example for me of not going for the bag design, but im still a sucker for the bags 🤣🤣. I havent tried there Black Cherry Gushers yet. I need to get there Watermelon Gelato also when it comes back around.', 'https://yt3.ggpht.com/oFhc4aVy0FGDonm7rz-lamg2nIRCzJajTqkTYpfVXgCpjFRij1qptvTMvrA3Ryvzzumpeptf=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 01:15:30', '2022-06-11 01:15:30'),
