(399, 45, 'Jeremy Johnson', 'http://www.youtube.com/channel/UC4NMp0nkLGbnGGkzwFeP9VA', 'I&#39;ve noticed since I&#39;ve been smoking vapor cup I don&#39;t really get locked in the couch.. I gets me stoned but clear and can still go about my day, love it!', 'https://yt3.ggpht.com/ytc/AKedOLR5oWQhwz6PRRnWHdqD_YpTRh2GVmYNmoUL0g=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 01:15:30', '2022-06-11 01:15:30'),
(400, 45, 'CRUZR454SS', 'http://www.youtube.com/channel/UCsbpyhEMQ1I4lMXBu2uOBdQ', 'Doc great review!<br>Can you do a multi cultivator GMO review ?', 'https://yt3.ggpht.com/ytc/AKedOLSoZ9swqW0gVCYat4NSTj5OUzduEFmwAdUVXPWbXUmFWZ96-aP4osj9r-Bs9Mbr=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 01:15:30', '2022-06-11 01:15:30'),
(401, 45, 'Ketsueki Tsuki Gamer', 'http://www.youtube.com/channel/UCix3_cRkTJEO4yueEUTR5-g', 'Doc, I feel like this year is gonna be more White strains; because I got three white strain on me now Super White Cherry, The White and Snow White. Snow White is Unbelievable good in the Vaporcup, the flavor was like tea but Clementine Citrus flavor. But I may go check out White Cherry Gushers later this weekend and tell you have it is in the vaporcup.', 'https://yt3.ggpht.com/ytc/AKedOLR0BG9sF8h_6ETCRj-6a_VU_FMBVrFLCdBTgc7HSg=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 01:15:30', '2022-06-11 01:15:30'),
(402, 45, 'Andrew Sandberg', 'http://www.youtube.com/channel/UCE98W9rJKyrQ1fEthCVCSsQ', 'Heavy couch lock flowers have a use for me after work at night time Doc but the functional uplifting flowers are best for during the day I agree', 'https://yt3.ggpht.com/ytc/AKedOLSu9dnNShXNKmLLo9GYNnZWPEDouyJl-LaNGV75lw=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 01:15:30', '2022-06-11 01:15:30'),
