(123, 52, 'Ddeven Ba6r', 'http://www.youtube.com/channel/UCnzneIO6w5Tk083sZY13Sug', 'Hi Matt, the PeeYew from Smokers Club was nice too and stinky, but I liked Cronuts better. They both still had stickiness to it and were cured nicely. Unfortunately, lately I&#39;ve gotten stuff that was supposed to be fresh from Teds Budz and Gooniez, but the flowers were dry and/or flushed/cured improperly taking away from the quality of the strain, but hopefully the suppliers and growers figure it out for the customer&#39;s sake, and not turn this magical plant into for-profit only side gigs.', 'https://yt3.ggpht.com/ytc/AKedOLTJAO7pdDljFCRLYOtJOtjIZpJ0IhDH9PC16w=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 01:02:28', '2022-06-11 01:02:28'),
