(127, 53, 'Weed Entertainment', 'http://www.youtube.com/channel/UCWDchBxn_dwQmQTcfSDZt3w', 'Jaylan,<br>Not really, weed was to hard to get when I was younger and to smoke it all up in one big fat joint was not happening..<br>I was scraping the tray for scraps then cleaning the bong stem for resin.. nothing gets wasted. Sometimes there was nothing around when it got dry.. with that said, life goes by fast…. I use mostly bongs and pipes with some joints when I was younger. I have always tried to conserve for fear of being out.. This lasted 25 years and then I new it was time to stop.. everyone will because you start to get throat irritation.. it’s coming to all blunt smokers.. even Breal said his blunt days are over to me… I have only vaporized for the last 16 years.. I’m so glad I made the switch otherwise I would have an additional 16 years of smoking in me.. I have used VaporCup for the last 7 years.. most people who get it are are awe of the smoothness and flavor..<br>If you don’t have VaporCup, grab it..<br>Don’t look back.. it will minimize tolerance and make the flower experience better.<br>I need to get things done.. VaporCup allows use anyplace anytime and really nobody knows. Party on.. <br>😎✌🏼', 'https://yt3.ggpht.com/ytc/AKedOLRFSsbEuMEKvmsc3XUbZiMD9Vpqlxl8xncLYmq4Cg=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 01:02:28', '2022-06-11 01:02:28'),
