(259, 120, 'Weed Entertainment', 'http://www.youtube.com/channel/UCWDchBxn_dwQmQTcfSDZt3w', 'Tony,<br>I have used VaporCup for 7 years and I used the volcano many many times. I actually had a Volcano at one time. There really is no comparison. You can read reviews on <a href=\"http://vaporcup.com/\">VaporCup.com</a> from people who have both.<br>The volcano will sit in your closet while VaporCup is a daily driver, the flavor is better from VaporCup.. it’s better in every way for me.. no bags for the Doc.. <br>I don’t like the volcano actually..<br>VaporCup is much less expensive too..<br>If you get VaporCup, it will change the way you use flowers forever..<br>🔥🔥🔥<br>😎✌🏼', 'https://yt3.ggpht.com/ytc/AKedOLRFSsbEuMEKvmsc3XUbZiMD9Vpqlxl8xncLYmq4Cg=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 01:05:52', '2022-06-11 01:05:52'),
