(523, 255, 'Weed Entertainment', 'http://www.youtube.com/channel/UCWDchBxn_dwQmQTcfSDZt3w', 'WowPOV,<br>I can’t answer the question exactly but I can give you my feeling about strains in general.<br>Most strains are not what they claim to be.<br>Most strains are called what the cultivator who gave it to the cultivator calls it or a name made up by the person who is cultivating it.<br>We are likely buying the same strain over and over again under different names.. <br>The cultivator really makes a difference and good genetics are fleeting.<br>Runtz flowers are good genetics, with that said a friend of mine says he is growing Runtz in his garage (legally). I don’t think it’s original Runtz but it will be called Runtz..<br>Buyer beware.. this show catches the best batches. You can know it’s good which is the goal..<br>🔥🔥🔥😎✌🏼', 'https://yt3.ggpht.com/ytc/AKedOLRFSsbEuMEKvmsc3XUbZiMD9Vpqlxl8xncLYmq4Cg=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 01:12:52', '2022-06-11 01:12:52'),
