(525, 257, 'Weed Entertainment', 'http://www.youtube.com/channel/UCWDchBxn_dwQmQTcfSDZt3w', 'Jason,<br>Pay attention to 8.75 flowers too.<br>Yes, the 9 is rare but 8.75 is also rare and very strong too. The difference is usually the 9 comes with euphoria..<br>Even some 8.65 can be a winner.. <br>it’s less heavy.. but still good for daytime.<br>As I age, I can see I need heavier flowers.<br>VaporCup allows to use less and feel like I’m using more.. it’s a fine line as to much use over years it just stops working.. <br>You may know this already..<br>Just a helpful comment after many years of trials..<br>Keep the Party going..<br>😎✌🏼', 'https://yt3.ggpht.com/ytc/AKedOLRFSsbEuMEKvmsc3XUbZiMD9Vpqlxl8xncLYmq4Cg=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 01:13:19', '2022-06-11 01:13:19'),
