(584, 291, 'Weed Entertainment', 'http://www.youtube.com/channel/UCWDchBxn_dwQmQTcfSDZt3w', 'Luis,<br>I have passed Bool Aid many times already.<br>Do you think it’s a try? <br>The Lemonnade store had me passing it?<br>What strain from the 10 co should I look for?<br>Party on..<br>😎✌🏼', 'https://yt3.ggpht.com/ytc/AKedOLRFSsbEuMEKvmsc3XUbZiMD9Vpqlxl8xncLYmq4Cg=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 01:13:54', '2022-06-11 01:13:54'),
