(586, 292, 'Weed Entertainment', 'http://www.youtube.com/channel/UCWDchBxn_dwQmQTcfSDZt3w', 'SD,<br>I will apply for a license now.<br>If I get lucky again… my flowers will not be <br>gelatos.. it time for the market to change.<br>We are buying brothers and sisters of the same thing over and over again.<br>I will talk about it on the Sat wake and bake with the Doc. We are setting up to film now  but it’s hard to film as we are facing glare from monitors reflecting back.. There will be Sat posts on <a href=\"http://weedentertainment.com/\">WeedEntertainment.com</a> talking more frankly and non censored. <br>😎👍👍', 'https://yt3.ggpht.com/ytc/AKedOLRFSsbEuMEKvmsc3XUbZiMD9Vpqlxl8xncLYmq4Cg=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 01:13:54', '2022-06-11 01:13:54'),
