(589, 292, 'SD Trail Rider', 'http://www.youtube.com/channel/UCjIOdmlRcGwsE2RiJHRjR5A', '@Ears2MyMusic88 Thanks! You found out the strain cross for Omnichronic.! So much Gelato 41 on that list.', 'https://yt3.ggpht.com/ytc/AKedOLS40g0lWFpXqpwVMsH4NGP7wyh9xN-tz_N5ITHh=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 01:13:54', '2022-06-11 01:13:54'),
