(770, 399, 'Weed Entertainment', 'http://www.youtube.com/channel/UCWDchBxn_dwQmQTcfSDZt3w', 'Jeremy,<br>It’s a game changer.<br>Getting locked in the couch can be for years..<br>Time goes by so fast and in life you can be couch locked and miss opportunities..<br>I appreciate your post as people still don’t get how revolutionary VaporCup is.<br>It’s by pros for pros and can take daily heavy use. It’s so perfect for my use as I’m busy so I can use it and not bother anyone (they don’t even know) all day. With the right strains you can stay on track.. well some what… <br>Please let people know.. <br>Change doesn’t come easy and I will never smoke again. Only VaporCup can do it..<br>It stays clean.. just clean the glass straws once a week and clean the removable chamber and that screen once a month or two or even three.. it really can take heavy use and it will keep getting better and better as you learn to use it better.<br>People love it.. I love it..<br>It’s part of the reason I do the show..<br>The Doc takes care of business.<br>So should everyone.. <br>it’s also really cheap for what comes with it..<br>Your comments is appreciated..<br>Your in the journey….. only the best for us..<br>🔥🔥🔥✌🏼😎', 'https://yt3.ggpht.com/ytc/AKedOLRFSsbEuMEKvmsc3XUbZiMD9Vpqlxl8xncLYmq4Cg=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 01:15:30', '2022-06-11 01:15:30'),
(771, 400, 'Weed Entertainment', 'http://www.youtube.com/channel/UCWDchBxn_dwQmQTcfSDZt3w', 'Cruz,<br>GMO has not been a go to strain for me.<br>I’m totally a heavyweight and I don’t like couch lock so the strains that get the 9 are unique heavyweights with focus and euphoria. I don’t let weed get me lazy..<br>There are better people than me for that..<br>It’s just not my go to at all..<br>Which doesn’t mean there are not great batches. Anything can be the best if the batch is right on..<br>😎✌🏼', 'https://yt3.ggpht.com/ytc/AKedOLRFSsbEuMEKvmsc3XUbZiMD9Vpqlxl8xncLYmq4Cg=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 01:15:30', '2022-06-11 01:15:30'),
(772, 401, 'Weed Entertainment', 'http://www.youtube.com/channel/UCWDchBxn_dwQmQTcfSDZt3w', 'Ketsueki,<br>Who is cultivator for Snow White..?<br>Thanks for the post and letting people understand about VaporCup.<br>People don’t understand how flavorful and what a game changer / flower saver VaporCup is..<br>It really changed my life.. it’s part of the reason I do the show.. it’s by pros for pros.<br>Totally not a mainstream item..<br>It’s great for daily breaks.. <br>You can’t fool it.. that’s how I know so many strains are gelatos.. or OG’s..<br>Happy Thursday.. live the dream..<br>😎🔥🔥🔥✌🏼', 'https://yt3.ggpht.com/ytc/AKedOLRFSsbEuMEKvmsc3XUbZiMD9Vpqlxl8xncLYmq4Cg=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 01:15:30', '2022-06-11 01:15:30'),
(773, 402, 'shaun green', 'http://www.youtube.com/channel/UCxjZyYdMSyjm9Ed9sGjx7fQ', 'Very helpful and thank you...I suffer from nerve pain...ulcers...just had 2 disc replaced in my neck in January,had a lower back surgery in 2018...and 2 leg surgeries in 2017...metal still in as my neck,insomniac since 14....but herb helps,I hate pills,thanks again for the information and the &quot;bomb ass&quot; videos my brother,party on😎✊🏼', 'https://yt3.ggpht.com/ytc/AKedOLRDWArxm-WKshWBHzyHpNCbhZGKDlVwCksUBA=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 01:15:30', '2022-06-11 01:15:30'),
(774, 402, 'Weed Entertainment', 'http://www.youtube.com/channel/UCWDchBxn_dwQmQTcfSDZt3w', 'Shaun,<br>I have passed Fire Society Gumbo a few times.. <br>I almost bought it a few times as it’s been sometime since I reviewed a Fire Society strain and I want to.<br>There really hasn’t been any comments on Gumbo yet.. The level of flowers reviewed here is very high because most tries are tips from insiders here.. <br>* anyone tried Fire Society Gumbo?? Please post below.<br>* As for pain management, I’m not a real Dr so I can’t give medical advise.. with that said.. Do you need help with sleeping or to manage pain like arthritis..<br>There are people here who manage both so maybe this post will get some feedback..<br>For sleep maybe try Backpack Boys White Cherry Gelato… it heavy and ends sleepy<br>For others issues like arthritis. I really suggest feedback from someone with the issue.. one other suggestion maybe <br>Connected Slowlane..<br>Lastly, you may want to consider a low dose edible. You will need to try a few to find the right one.. you could try space gems.<br>This was recommended by a friend in the know but I haven’t tried.. <br>I hope you find this helpful.<br>I am not giving any medical advise….<br>😎✌🏼', 'https://yt3.ggpht.com/ytc/AKedOLRFSsbEuMEKvmsc3XUbZiMD9Vpqlxl8xncLYmq4Cg=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 01:15:30', '2022-06-11 01:15:30'),
