(776, 402, 'Weed Entertainment', 'http://www.youtube.com/channel/UCWDchBxn_dwQmQTcfSDZt3w', 'Andrew,<br>Every once in awhile I appreciate the heavy heavy.. but in general I like creative, happy flowers.. the Doc is not lazy and I don’t have a life that will allow that..<br>It’s great to hear from you..<br>🔥🔥🔥😎✌🏼', 'https://yt3.ggpht.com/ytc/AKedOLRFSsbEuMEKvmsc3XUbZiMD9Vpqlxl8xncLYmq4Cg=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 01:15:30', '2022-06-11 01:15:30'),
