(778, 403, 'Weed Entertainment', 'http://www.youtube.com/channel/UCWDchBxn_dwQmQTcfSDZt3w', 'Rob,<br>I don’t really look at the packaging dates.<br>The BPB White Cherry Gushers was a new drop of Lemonnade VN. I had high hopes for this flower. No pun intended..<br>it just wasn’t the euphoric flower I was looking for. Most flowers are not as strong thus the high rating but I would not rebuy and it was not a top BPB strain for me. I definitely think Connected Gushers or Big Al’s Gushers just Plushers was much better IMHO..<br>Let the best flower be known so we can all enjoy them.<br>😎✌🏼', 'https://yt3.ggpht.com/ytc/AKedOLRFSsbEuMEKvmsc3XUbZiMD9Vpqlxl8xncLYmq4Cg=s48-c-k-c0x00ffffff-no-rj', 1, '2022-06-11 01:15:30', '2022-06-11 01:15:30'),
